      style={{
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#e7c0ff",
        borderRadius: 24,
        width: 100,
        height: 100,
        margin: 100,
      }}
    >
      {word}
    </div>
  );
}

const styles = StyleSheet.create({
  card: {
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "e7c0ff",
